import React, {Route, Routes} from 'react'
import {ProductPage} from './pages/ProductPage'
function App() {
  return (
    <>
      <Routes>
        <Route path="/" element={ <ProductsPage /> } />
      </Routes>
    </>
  )
}

export default App;
